css:
@-moz-document domain("feedreader.com") {
#main {background-color: #313a3e;}
.entry-wrapper_odd {background-color: #364044;}
.entry__summary__title {color: #f4f4f4;}
.entry__summary__date {color: #cfe8e6;}
.entry__source__link {color: #cfe8e6;}
.entry__arrow {filter: invert(100%)}
.entry__original_link {filter: invert(100%)}
.entry__action {color: #cfe8e6;}
.entry__action:hover {color: #cfe8e6;}
.entry__action__icon {filter: invert(100%)}
.entry__body {color: #f4f4f4;}
.entry__body__container p em {color: #cfe8e6;}
.entry__body a {color: #42ce94;}
.entry__body a:hover {color: #42ce94;}
.entry__body a:active {color: #42ce94;}
.entry__body a:visited {color: #42ce94;}
.entry__body a img {filter: invert(100%);}
}
